import React, {  useState } from 'react';
import s from './head.module.css';
let data_1 = [
    {
        li_name: "ресив",
        ul_notis: ["notis_123", "notis_111",, "notis_111", "notis_222", "notis_111", "notis_222", "notis_222"],
        model: [11, 22, 33, 44, 55],
    },
    {
        li_name: "dd",
        ul_notis: [],
        model: ["model_222","model_333"],
    },
    {
        li_name: "каналы",
        ul_notis: ["notis_123", "notis_111", "notis_222", "notis_222", "notis_222"],
        model: [4, 55],
    },
    {
        li_name: "баги",
        ul_notis: ["123"],
        model: [11, 22, 33, 44, 55],
    },
    {
        li_name: "заказы",
        ul_notis: ["133", "111", "222"],
        model: [],
    },
    {
        li_name: "IT",
        ul_notis: [],
        model: [115],
    },
]



const Ul_li = data_1.map(el => 

    <ul>
        {
          el.li_name !== "" ? <li><a>{el.li_name}</a>
                                {el.ul_notis.length !== 0 ? <ul><li><a>{el.ul_notis.map(x => x)}</a></li></ul> : null}
                                {console.log(el.ul_notis.length)}                          
                              </li> : null
        }
    </ul>
)
        




